import React from "react";
import "./card.styles.css";
export const Card = (props) => (
  <div className="card-container">
    <img
      alt="monster"
      src={`https://robohash.org/${props.monster.id}?set=set2size=180*180`}
    />
    <h2>{props.monster.name}</h2>
  </div>
);
